import React, { useState } from 'react';

import Header from './Header';

function App() {
  const [counter, setCounter] = useState(0);

  return (
    <div>
      <Header>Contador: {counter}</Header>
      <button onClick={setCounter(counter++)}>Incrementar</button>
    </div>

  );
}

export default App;
